import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        {/* Navigation Bar */}
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/courses">Courses</Link>
            </li>
            <li>
              <Link to="/more-courses">More Courses</Link>
            </li>
          </ul>
        </nav>

        {/* Routing setup */}
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/courses" element={<Courses />} />
          <Route path="/more-courses" element={<MoreCourses />} />
        </Routes>
      </div>
    </Router>
  );
}

// Home Page Component
function Home() {
  return <h1>Welcome to the Course Recommendation Page</h1>;
}

// Courses Page Component
function Courses() {
  return (
    <div>
      <h2>Our Top Courses</h2>
      <div className="course-list">
        <div className="course">
          <h3>Web Development</h3>
          <p>Learn to build websites using modern tools and technologies.</p>
        </div>
        <div className="course">
          <h3>Data Science</h3>
          <p>Master data analysis, machine learning, and data visualization.</p>
        </div>
        <div className="course">
          <h3>Mobile App Development</h3>
          <p>Build apps for iOS and Android from scratch.</p>
        </div>
      </div>
    </div>
  );
}

// More Courses Page Component
function MoreCourses() {
  return (
    <div>
      <h2>Explore More Courses</h2>
      <div className="course-list">
        <div className="course">
          <h3>AI and Machine Learning</h3>
          <p>Delve into artificial intelligence and machine learning techniques.</p>
        </div>
        <div className="course">
          <h3>Cybersecurity</h3>
          <p>Learn how to protect systems and data from cyber threats.</p>
        </div>
        <div className="course">
          <h3>Cloud Computing</h3>
          <p>Master cloud technologies and services such as AWS, Azure, and Google Cloud.</p>
        </div>
        <div className="course">
          <h3>Blockchain Development</h3>
          <p>Understand blockchain technology and learn how to develop decentralized applications.</p>
        </div>
      </div>
    </div>
  );
}

export default App;
